import React, { useEffect, useState } from "react";
import axios from "axios";

const HomePage = () => {
  const [image, setImage] = useState(null);

  useEffect(() => {
    axios
      .get("https://source.unsplash.com/random")
      .then((response) => {
        setImage(response.request.responseURL);
      })
      .catch((error) => console.error("Błąd przy pobieraniu zdjęcia:", error));
  }, []);

  return (
    <div>
      <h2>Witaj, Tadeusz!</h2>
      {image ? (
        <img
          src={image}
          alt="Losowe zdjęcie z Unsplash"
          style={{ width: "100%", maxWidth: "600px" }}
        />
      ) : (
        <p>Ładowanie zdjęcia...</p>
      )}
    </div>
  );
};

export default HomePage;
